1. **Create the First Person Controller Script:**

Create a new GDScript and attach it to a `KinematicBody` node. Here is a basic example:

```gdscript
extends KinematicBody

# Used for the first-person look controls
var isFirstPerson = false

func _ready():
    # Initialize first person controls
    set$isFirstPerson(true)
    if $this is Node:
        $this->setControlType(1)  # 1 is for first person control

