    if $this is Node and $this is KinematicBody:
        if $this is KinematicBody and $this.isKinematicBody:
            # Handle first person look controls
            if $this.isFirstPerson:
                $this->getControl().setControlType(0)  # 0 is for landscape
            else:
                $this->getControl().setControlType(1)  # 1 is for first person

func _input_process(delta):
