In Godot Engine 4.x, the way to handle first-person controllers has changed. The `KinematicBody` node itself does not exist in Godot 4.x; instead, you will use `KinematicBody` nodes and control the camera with `CameraNode`. You will also need to use the `getControl` method to get the controls and set them.

