int countWordOccurrences(const string& filePath, const string& word) {
    int count = 0;
    string line;
    ifstream file(filePath);
    while (file.is_open()) {
        line = file.readline();
        if (line.empty() || line.length() > 0) continue;
        if (line.find(word) == string::npos) {
            continue;
        }
        count++;
        file.close();
    }
    return count;
}

